                function urineTestValueFineTune(urineTestVal){
                  if(urineTestVal != undefined){
                    if(urineTestVal.includes("+")){
                      fintueValue = "Present";
                    } else if(urineTestVal.includes("-")){
                      fintueValue = "Absent";
                    } else if(urineTestVal.trim().length == 0){ 
                      fintueValue = "Nil";
                    } else {
                      fintueValue = urineTestVal;
                    }
                  }else {
                    fintueValue = urineTestVal;
                  }
                  return fintueValue;
                }
