    $scope.zugpanel = function(){
        if (typeof(HigiKioskStorageService.returnSessionData('HeartRate')) != "undefined") {
            //Bp was taken
            $scope.zugTaken = true;
            //$scope.diastolic = HigiKioskStorageService.returnSessionData('diastolic');
            //$scope.systolic = HigiKioskStorageService.returnSessionData('systolic');
            $scope.ecgbpm = HigiKioskStorageService.returnSessionData('HeartRate');
        }
        else {
            $scope.zugTaken = false;
            $scope.zugrisk = 'global.not.taken';
        }

      $scope.zugstatuspanel = function(){

         if (HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead1') != undefined || HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead2') != undefined){

            $scope.zugstatus = true;

            $scope.ecgstat = HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead2');


         }else if(HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead2') == undefined || HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead2') == null){

          $scope.ecgstat = HigiKioskStorageService.returnSessionData('zugEcgValidationResultforLead1');
         }else {
            $scope.zugstatus = false;
            $scope.zugrisk = 'global.not.taken';
        }
      }



        if (HigiKioskStorageService.returnSessionData('pulse') != undefined) {
            $scope.pulseTaken = true;
            $scope.pulse = HigiKioskStorageService.returnSessionData('pulse');
            var pulseRisk = HigiKioskUtilitiesService.calculatePulseRisk($scope.pulse);
            if (pulseRisk == 'high') {
                $scope.pulseRiskClass = 'high';
                $scope.pulseRisk = 'global.highpulse';
            }
            else if (pulseRisk == 'low') {
                $scope.pulseRiskClass = 'low';
                $scope.pulseRisk = 'global.lowpulse';

            }
            else if (pulseRisk == 'acceptable') {
                $scope.pulseRiskClass = 'normal';
                $scope.pulseRisk = 'finish.status.accep';

            }
            else if (pulseRisk == 'check with healthcare provider') {
                $scope.pulseRiskClass = 'high';
                $scope.pulseRisk = 'finish.recheck_consult_healthcare_provider';

            }
            else {
                $scope.pulseRiskClass = 'normal';
                $scope.pulseRisk = 'global.normalbp';
            }
        }
        else {
            $scope.pulseTaken = false;
            $scope.pulseRiskClass = '';
            $scope.pulseRisk = 'global.not.taken';
        }
    };




