  $rootScope.initFinishPageVitalTest = function(vitalType) {
    $rootScope.initFinishPageDietRecommendation('vital', true, vitalType); // vitalType - invasive, non-invasive
    return new Promise((resolve, reject) => {
      const intervalId = setInterval(() => {
        if ($scope.checkVitalSharedData()) {
            clearInterval(intervalId);
            resolve($scope.vitalSharedData);
            $scope.vitalSharedData = {};
        }
      }, 2000);
    });
  }

  $scope.checkVitalSharedData = function() {
    if (Object.keys($scope.vitalSharedData).length != 0)
      return true;
    return false;
  }

