  $scope.BCAHistoryDateFormatforKolors = function(Timestampstring){

    // Input date string
    const inputDate = Timestampstring;
    // Extract the timestamp from the input string
    
    const timestamp = parseInt(inputDate.match(/\d+/)[0]);
    

    
    // Convert the timestamp to a Date object
    const date = new Date(timestamp);
    // Define an array of month names
    const monthNames = [
      "Jan", "Feb", "Mar", "Apr", "May", "Jun",
      "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"    
    ];

    // Get the components of the date
    const day = date.getDate();
    const month = monthNames[date.getMonth()];
    const year = date.getFullYear();
    const hours = date.getHours();
    const minutes = date.getMinutes();    
    const ampm = hours >= 12 ? "PM" : "AM";

    // Format the date and time
    const formattedDate = `${day} ${month} ${year} ${hours % 12}:${(minutes < 10 ? '0' : '') + minutes} ${ampm}`;
    // console.log(formattedDate); // Output: "03 Feb 2023 12:45 PM"    
    return formattedDate;
  }

