  $scope.getBloodPressureResult = function() {
    let bpObj = {
      "sys": "",
      "dia": "",
      "unit": "mmHg",
      "name": "BLOOD_PRESSURE"
    }

    let hrObj = {
      "result": "",
      "unit": "mmHg",
      "type": "PHYSICAL",
      "name": "HEART_RATE"
    }

    let systolic = HigiKioskStorageService.returnSessionData('systolic');
    let diastolic = HigiKioskStorageService.returnSessionData('diastolic');
    let pulse = HigiKioskStorageService.returnSessionData('pulse');

    if (systolic != undefined && diastolic != undefined) {
      bpObj['sys'] = parseFloat(systolic);
      bpObj['dia'] = parseFloat(diastolic);
      $scope.testResult['visitData']['tests'].push(bpObj);
    } else {
        $rootScope.missingTestRequest.push(bpObj['name']);
    }

    if (pulse != undefined) {
      hrObj['result'] = parseFloat(pulse);
      $scope.testResult['visitData']['tests'].push(hrObj);
    } else {
        $rootScope.missingTestRequest.push(hrObj['name']);
    }
  }
  /* GET BLOOD PRESSURE RESULT FUNCTIONALITY END */

  /* GET WIEGHTBMI RESULT FUNCTIONALITY START */
  $scope.getWeightBMIResult = function() {
    let wObj = {
      "result": "",
      "unit": "Kgs",
      "name": "WEIGHT"
    }

    let bmiObj = {
      "bmiValue": "",
      "weightValue": "",
      "heightValue": "",
      "weightUnit": "Kgs",
      "heightUnit": "cms",
      "name": "BMI"
    }

    let weight = HigiKioskStorageService.returnSessionData('weight');
    let height = HigiKioskUtilitiesService.convertToFeetFoot(HigiKioskStorageService.returnSessionData('height')) + "." + HigiKioskUtilitiesService.convertToFeetInches(HigiKioskStorageService.returnSessionData('height'));
    let heightCM = HigiKioskStorageService.returnSessionData('height') * 100;

    if (weight != undefined) {
      /* WEIGHT */
      if ($rootScope.testList.includes('WEIGHT')) {
        let weightVal = Math.round((HigiKioskStorageService.returnSessionData('weight'))* 100) / 100;
        wObj['result'] = weightVal;
        $scope.testResult['visitData']['tests'].push(wObj);
      }


      /* BMI */
      let weightVal = Math.round((HigiKioskStorageService.returnSessionData('weight'))* 100) / 100;
      let bmi = HigiKioskUtilitiesService.calculateBmi(HigiKioskStorageService.returnSessionData('weight'), HigiKioskStorageService.returnSessionData('height'), 2);

      if (!Number.isInteger(heightCM))
        heightCM = heightCM.toFixed(2);

      bmiObj['bmiValue'] = parseFloat(bmi);
      bmiObj['weightValue'] = weightVal;
      bmiObj['heightValue'] = heightCM;
      $scope.testResult['visitData']['tests'].push(bmiObj);
    } else {
      $rootScope.missingTestRequest.push(bmiObj['name']);
    }
  }
  /* GET WIEGHTBMI RESULT FUNCTIONALITY END */

