  $scope.sendTestRequestResultToESanjeevani = function() {
      console.log('SendTestRequest');
      $('#eSanSendResponseModal').show();
      $.ajax({
        url: getSettingsValue('kiosk.port')+'/server/esanjeevani/eSanjeevaniApi.php',
        method: 'POST',
        data: {'FunctionName': 'SendTestRequestToESanjeevani', 'testResult': JSON.stringify($scope.testResult)},
        success: function(data) {
            console.log(data);
            $('#eSanSendResponseModal').hide();
            if (data['Status'] == 'S') {
              if ($scope.ecgUploadFileName != '')
                $scope.uploadECGPdfFile();
              $rootScope.eSanTestResultMsg = data['Msg'];
              $scope.checkTestResultStatus();
              console.log($rootScope.eSanTestResultMsg);
            } else {
              $rootScope.eSanTestResultFailedMsg = data['Msg'];
            }
            // if ($rootScope.missingTestRequest.length == 0)
            $scope.esanjeevaniServiceProvidedUpdate();
            $rootScope.eSanSendResponseBtn = false;

            $timeout(() => {
              if ($rootScope.eSanTestResultMsg != '' && $rootScope.missingTestRequest.length == 0)
                $("#eSanTestRequestSuccess").show();

              if ($rootScope.eSanTestResultMsg != '' && $rootScope.missingTestRequest.length != 0)
                $("#eSanTestRequestSuccessFailed").show();

              if ($rootScope.eSanTestResultFailedMsg != '')
                  $("#eSanTestRequestFailed").show();
            }, 500);
        },
        error: function(data) {
            console.log(data);
            $rootScope.eSanSendResponseBtn = false;
            $('#eSanSendResponseModal').hide();
            $rootScope.eSanTestResultFailedMsg = 'Internal server Error';
            if ($rootScope.eSanTestResultFailedMsg != '')
                  $("#eSanTestRequestFailed").show();
        }
      });

      //data send to IHL DB
      $scope.checkinDataStoreToIHL();
  }
