  $scope.checkTestResultStatus = function() {
    let successTestArr = [];
    /* SUCCESS */
    angular.forEach($scope.testResult, function(val) {
      angular.forEach(val['tests'], function(item) {
        successTestArr.push(item['name'])
        if (item['name'] == 'BMI')
          successTestArr.push('WEIGHT', 'HEIGHT');
      });
    });

    angular.forEach(successTestArr, function(name) {
      let resSuccess = $rootScope.testRequestList.find(x => x.name === name);
      resSuccess['isSuccess'] = true;
    });

    /* FAILED */
    if ($rootScope.missingTestRequest.includes('BMI'))
      $rootScope.missingTestRequest.push('WEIGHT');

    angular.forEach($rootScope.missingTestRequest, function(name) {
      let resFailed = $rootScope.testRequestList.find(x => x.name === name);
      resFailed['isFailed'] = true;
    });
  }
