  /* GET TEST RESULT FOR MEHTA FUNCTIONALITY START */
  $scope.getTestResultForMehta = function() {
    let vitalArr = {
      "MRNO": $rootScope.mehtaPatientMRNo,
      "SBP": 0,
      "DBP": 0,
      "PULSESRATE": 0,
      "TEMPERATURE": 0,
      "BMI": 0,
      "WEIGHT": 0,
      "LENGTH": 0,
      "SPO": 0
    };

    $scope.vitalTestTaken = false;

    /* BLOOD PRESSURE */
    let systolic = HigiKioskStorageService.returnSessionData('systolic');
    let diastolic = HigiKioskStorageService.returnSessionData('diastolic');
    let pulse = HigiKioskStorageService.returnSessionData('pulse');

    if (systolic != undefined && diastolic != undefined) {
      vitalArr['SBP'] = systolic;
      vitalArr['DBP'] = diastolic;
      $scope.vitalTestTaken = true;
    }

    if (pulse != undefined)
      vitalArr['PULSESRATE'] = pulse;

    /* TEMPERATURE */
    let temp = HigiKioskStorageService.returnSessionData('temperaturFarrant');

    if (temp != undefined) {
      vitalArr['TEMPERATURE'] = parseFloat(temp);
      $scope.vitalTestTaken = true;
    }

    /* BMI */

    let weight = HigiKioskStorageService.returnSessionData('weight');
    let heightCM = HigiKioskStorageService.returnSessionData('height') * 100;

    if (weight != undefined) {

      let weightVal = Math.round((HigiKioskStorageService.returnSessionData('weight'))* 100) / 100;
      let bmi = HigiKioskUtilitiesService.calculateBmi(HigiKioskStorageService.returnSessionData('weight'), HigiKioskStorageService.returnSessionData('height'), 2);

      if (!Number.isInteger(heightCM))
        heightCM = heightCM.toFixed(2);

        vitalArr['BMI'] = parseFloat(bmi);
        vitalArr['WEIGHT'] = weightVal;
        vitalArr['LENGTH'] = heightCM;
        $scope.vitalTestTaken = true;
    }

    /* SPO2 */

    let spo2 = HigiKioskStorageService.returnSessionData('oxygen');
  
    if (spo2 != undefined) {
      vitalArr['SPO'] = parseFloat(spo2);
      $scope.vitalTestTaken = true;
    }
    
    if ($scope.vitalTestTaken)
      $scope.sendTestResultToMehta([vitalArr]);
    else
      $scope.mehtaLinkedWithHPod();
  }
  /* GET TEST RESULT FOR MEHTA FUNCTIONALITY END */

